import React from 'react'

const Hello = (props) => {
    return (
        <div>
            <p>
                Hello {props.name}, your are {props.age} years old
            </p>
        </div>
    )
}

const App = () =>{
    const name = 'Anna'
    const age = 36

    return (
        <div>
            <h1>Greetings</h1>
            <Hello name='Victor' age={30+20} />
            <Hello name={name} age={age} />
        </div>
    )
}

export default App;
